import React from 'react'
import {Link,Outlet} from'react-router-dom';
const Dashboard = ()=> {
    return(
    <div>
        <div>
        <Link to="/dashboard/create">Create</Link>
        <Link to="/dashboard/view">View</Link>
        </div>
        <Outlet/>
    </div>
    );
    
}
export default Dashboard
